import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";


const DialogItem = (props)=>{
  return(
    <ul className={s.item}>
          <li>
            <NavLink className={s.link + ' ' + s.active} to="/dialogs/1">
            {props.name}
            </NavLink>
          </li>
        </ul>
  )
}


const Message = (props) =>{
  return(
    <div></div>
  )
}

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogs_item}>
        <h1> Dialogs</h1>
        <DialogItem name='gluk1' id=''/>
        <DialogItem name='gluk2' id=''/>
        <DialogItem name='gluk3' id=''/>
        <DialogItem name='gluk4' id=''/>
        <DialogItem name='gluk5' id='' />
      </div>
      <div className={s.messages}>
        <div className="message_item">hi</div>
        <div className="message_item">you</div>
        <div className="message_item">what</div>
      </div>
    </div>
  );
};

